import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Number from "./Number.js";
import Operation from "./Operation.js";

const App = () => {
  let numberArr = [];
  let operationsArr = ["AC", "+/-", "%", "รท", "x", "-", "+", "="];
  let i = 9;
  while (i >= 0) numberArr.push(i--);

  return (
    <>
      <div>This is where the result will show up</div>
      {numberArr.map(number => (
        <Number key={number} number={number} />
      ))}
      {operationsArr.map(sign => (
        <Operation key={sign} sign={sign} />
      ))}
    </>
  );
};

export default App;
